var observer = null;
function observeRosterFetch()
{
	logToConsole(getDateTime() + 'Setting mutation summary...');
	var MutationSummary = window.MutationSummary || window.WebKitMutationSummary || window.MozMutationSummary;
	observer = new MutationSummary({
	  callback: myChatWindowManager,
	  queries: [{
		element: ".jabberwerx.contact.presence.show", //1. Monitor for status changes
		elementAttributes: 'title'
	  },{
		element: ".messageView" // 2. Monitor for new chat messages!
	  },{
		element: ".action_button.join" // 3. Monitor for group chat invitations!
	  }]
	});
}

function myChatWindowManager(summaries)
{
	initContactTracking(summaries);
	initMessageMonitor(summaries);
	initGroupChatInviteMonitor(summaries);
}

function initContactTracking(summaries) {
  var contacts = summaries[0];
  contacts.added.forEach(updateContactListAdded);
  contacts.removed.forEach(updateContactListRemoved);
  
  var changedType = contacts.attributeChanged['title'];
  userStatusChanged(changedType);
}

function updateContactListAdded(newEl)
{
	var contactDiv = $(newEl);
	var userName = $.trim(contactDiv.find('.displayname').text());
	var isUserVisible = $(contactDiv).is(':visible');
	var userStatus = $.trim($(contactDiv).attr('title'));
	var parentCSSClass = $(contactDiv).parent().attr('class');
	
	logToConsole("========" + userName + "========");
	logToConsole(getDateTime() + "User       = " + userName);
	logToConsole(getDateTime() + "Visible    = " + isUserVisible);
	logToConsole(getDateTime() + "Filtered   = " + isUserFiltered(userName));
	logToConsole(getDateTime() + "UserStatus = " + userStatus);
	logToConsole(getDateTime() + "Parent = " + $(contactDiv).parent());
	logToConsole(getDateTime() + "Parent CSS = " + $(contactDiv).parent().attr('class'));

	if(!isUserFiltered(userName) && (parentCSSClass!="jabberwerx chatview") && !("UNKNOWN"==userStatus.toUpperCase()))
	{
		var contactName = userName;
		if(!isAlreadyTracked(contactName))
		{
			addContact(contactName,userStatus);
			logToConsole(getDateTime() + ":User Added:'" + userName + "'");
			logToConsole(getDateTime() + "Done adding to tracker:" + userName);
		}
	}
	else
	{
		logToConsole(getDateTime() + ":User Not Added:'" + userName + "'");
	}
	logToConsole("========" + userName + "========");
}

function updateContactListRemoved(newEl)
{
	var contactDiv = $(newEl);
	var removedUser = $.trim(contactDiv.find('.displayname').text());
	var userStatus = $.trim($(contactDiv).attr('title'));
	var parentCSSClass = $(contactDiv).parent().attr('class');
	
	logToConsole("========" + removedUser + "========");
	logToConsole(getDateTime() + "User       = " + removedUser);
	logToConsole(getDateTime() + "Filtered   = " + isUserFiltered(removedUser));
	logToConsole(getDateTime() + "UserStatus = " + userStatus);
	logToConsole(getDateTime() + "Parent = " + $(contactDiv).parent());
	logToConsole(getDateTime() + "Parent CSS = " + parentCSSClass);
	
	if(!isUserFiltered(removedUser) && parentCSSClass && (parentCSSClass!="jabberwerx chatview"))
	{
		removeContact(removedUser);
		stopTracking(removedUser);
		logToConsole(getDateTime() + ":User Removed:'" + removedUser + "'");
		logToConsole(getDateTime() + "Done removing from tracker:" + removedUser);
	}
	else
	{
		logToConsole('User not removed from the storage, however calling stopTracking()');
		stopTracking(removedUser);
		logToConsole(getDateTime() + ":User Not Removed:'" + removedUser + "'");
	}
	logToConsole("========" + removedUser + "========");
}

function userStatusChanged(changeType)
{
	var contactDivs = $(changeType);
	var statusChanges = new Array();
	var contactNames = new Array();

	logToConsole(getDateTime() + "============working on status changes=========");
	contactDivs.each(function(index,elem) {
		var userName = $.trim($(this).find('.displayname').text());
		var userStatus = $.trim($(this).attr('title'));
		var isVisible = $(this).is(':visible');
		var userModified = false;
		var parentCSSClass = $(this).parent().attr('class');
		
		logToConsole(getDateTime() + "User Name=" + userName);
		logToConsole(getDateTime() + "User Status=" + userStatus);
		logToConsole(getDateTime() + "isUserVisible=" + isVisible);
		logToConsole(getDateTime() + 'isUserFiltered=' + isUserFiltered(userName));
		logToConsole(getDateTime() + 'isUserSubscribed=' + isUserSubscribed(userName));

		
		if(!userSubscriptionsDelayed)
		{
			if(isAlreadyTracked(userName))
			{
				logToConsole(getDateTime() + 'Waiting for User Subscriptions timer to tick and start initiating alerts!!!');
				logToConsole(getDateTime() + 'Updating the Status Tracker anyways...');
				updateCurrentStatus(userName,userStatus);
				logToConsole(getDateTime() + 'Done updating the Status Tracker...');
			}
			else
			{
				logToConsole(getDateTime() + 'No need to update the Status Tracker');
			}
			
			// return since the status ticking is not enabled yet
			return;
		}

		
		if(!isAlreadyTracked(userName) && !("UNKNOWN"==userStatus.toUpperCase()))
		{
			logToConsole(getDateTime() + "------****------");
			logToConsole(getDateTime() + ":Looks like a user is added with 'unknown' status and then the title is changed:'" + userName + "'.Lets add the user to the tracker");
			logToConsole(getDateTime() + "------****------");
			if(!isUserFiltered(userName))
			{
				addContact(userName,userStatus);
			}
			else
			{
				logToConsole(getDateTime() + 'Unable to add the user.... user is filtered!');
			}
			userModified=true;
		}
		else if(isAlreadyTracked(userName) && ("UNKNOWN"==userStatus.toUpperCase()))
		{
			logToConsole(getDateTime() + "------****------");
			logToConsole(getDateTime() + ":Looks like a user status is changed to unknown and the user will be removed:'" + userName + "'.Lets remove this guy from the tracker");
			logToConsole(getDateTime() + "------****------");
			
			if(!isUserFiltered(userName) && parentCSSClass && (parentCSSClass!="jabberwerx chatview"))
			{
				removeContact(userName);
				stopTracking(userName);
			}
			else
			{
				logToConsole(getDateTime() + 'Unable to remove the user.... user is either filtered or it is not required to remove!');
			}
			userModified=true;
		}
		
		if(!userModified && !isUserFiltered(userName) && isUserSubscribed(userName))
		{
			contactNames[contactNames.length] = userName;
			statusChanges[statusChanges.length] = userStatus;
		}
		else
		{
			logToConsole('No status change alert required for ' + userName);
		}
	});
	logToConsole(getDateTime() + "============done working on status changes=========");
	var alertNames = new Array();
	var alertStatus = new Array();

	if(contactNames.length >0)
	{
		logToConsole(getDateTime() + "============normalizing alerts per list of changes=========");
		for(var i=0;i<contactNames.length;i++)
		{
			var isDupe = false;
			
			logToConsole(getDateTime() + 'Applying Status change normalization rules for ' + contactNames[i]);
			
			for(var j=(i+1);j<contactNames.length;j++)
			{
				logToConsole(getDateTime() + 'Comparing contactNames[' + i +']=' + contactNames[i] + 'with contactNames[' + j +']=' + contactNames[j]);
				if(contactNames[i]==contactNames[j])
				{
					isDupe=true;
					logToConsole(getDateTime() + 'isDupe=' + isDupe);
				}
			}
			
			if(!isDupe)
			{
				if(!disableStatusChangeAlerts)
				{
					if(alwaysAlertMe)
					{
						logToConsole('User has opted to be alerted for all status changes!');
						logToConsole(getDateTime() + 'alertNames[' + alertNames.length + ']=' + contactNames[i]);
						logToConsole(getDateTime() + 'alertStatus[' + alertStatus.length + ']=' + statusChanges[i]);
						alertNames[alertNames.length] = contactNames[i];
						alertStatus[alertStatus.length] = statusChanges[i];
					}
					else if(determineAlertEligibility(contactNames[i],statusChanges[i]))
					{
						logToConsole('User needs to be alerted for this status change');
						logToConsole(getDateTime() + 'alertNames[' + alertNames.length + ']=' + contactNames[i]);
						logToConsole(getDateTime() + 'alertStatus[' + alertStatus.length + ']=' + statusChanges[i]);
						alertNames[alertNames.length] = contactNames[i];
						alertStatus[alertStatus.length] = statusChanges[i];
					}
				}

				// This should be done only after the possible alerts are generated.. after the below call.. the current and the previous status would be the same
				logToConsole(getDateTime() + 'Calling updateCurrentStatus() to keep the status tracker up to date!');
				updateCurrentStatus(contactNames[i],statusChanges[i]);
				logToConsole(getDateTime() + 'Done Calling updateCurrentStatus() to keep the status tracker up to date!');
			}
			else
			{
				logToConsole(getDateTime() + 'This is a dupe alert notification... Hence, no alert required..');
			}
		}
		logToConsole(getDateTime() + "============DONE normalizing alerts per list of changes=========");
		
		updateAlertQueue(alertNames,alertStatus);
	}
}

function determineAlertEligibility(contactName,currentStatus)
{
	if(!contactName || !currentStatus)
		return false;

	var previousStatus = getPreviousStatus(contactName);
	if(previousStatus == null)
	{
		logToConsole(getDateTime() + 'Previous status not found.. hence alerting user anyways!');
		return true;
	}
	else
	{
		logToConsole(getDateTime() + 'previousStatus=' + previousStatus);
		logToConsole(getDateTime() + 'currentStatus=' + currentStatus);
		currentStatus = normalizeStatus(currentStatus);
		previousStatus = normalizeStatus(previousStatus);
		logToConsole(getDateTime() + 'previousStatus(decoded)=' + previousStatus);
		logToConsole(getDateTime() + 'currentStatus(decoded)=' + currentStatus);
		var isAlertRequired = checkStatusTransition(previousStatus,currentStatus);
		logToConsole(getDateTime() + 'isAlertRequired=' + isAlertRequired);
		return isAlertRequired;
	}
}

function getPreviousStatus(contactName)
{
	for(var i=0;i<userNamesTracker.length;i++)
	{
		if(contactName == userNamesTracker[i])
		{
			logToConsole(getDateTime() + 'Previous Status for ' + contactName + ' @ userStatusTracker[' + i + '] is :' + userStatusTracker[i]);
			return userStatusTracker[i];
		}
	}
	logToConsole(getDateTime() + 'Previous Status not found for ' + contactName);
	return null;
}

function updateCurrentStatus(contactName,contactStatus)
{
	var userStatusUpdated = false;
	for(var i=0;i<userNamesTracker.length;i++)
	{
		if(contactName == userNamesTracker[i])
		{
			logToConsole(getDateTime() + contactName + ' @ userStatusTracker[' + i + '] - Previous Status:' + userStatusTracker[i] + ',Current Status:' + contactStatus);
			userStatusTracker[i]=contactStatus;
			userStatusUpdated=true;
		}
	}
	
	if(!userStatusUpdated)
	{
		logToConsole(getDateTime() + contactName + ':Unable to update status, contact not found in the Tracker');
	}
}

function normalizeStatus(sts)
{
	var decodedStatus;
	var stsDelimiter = " :: ";
	var stsAvailable = "Available";
	var stsAway = "Away";
	var stsDND = "Do Not Disturb";
	var stsOffline = "Offline";
		
	if(!sts)
	{
		logToConsole('Status seems to be undefined...');
		return;
	}
	
	if(sts == stsOffline)
	{
		decodedStatus = stsOffline;
	}
    else if((sts == stsAway)|| (sts == (stsAway + stsDelimiter + stsAway)) || sts.substring(0,4) == stsAway)
	{
		decodedStatus = stsAway;
	}
	else if((sts == stsAvailable)|| (sts == (stsAvailable + stsDelimiter + stsAvailable)) || sts.substring(0,9) == stsAvailable)
	{
		decodedStatus = stsAvailable;
	}
    else if((sts == stsDND)|| (sts == (stsDND + stsDelimiter + stsDND)) || sts.substring(0,14) == stsDND)
	{
		decodedStatus = stsDND;
	}
	
	return decodedStatus;
}

function checkStatusTransition(previousStatus,currentStatus)
{
	var stsDelimiter = " :: ";
	var stsAvailable = "Available";
	var stsAway = "Away";
	var stsDND = "Do Not Disturb";
	var stsOffline = "Offline";
		
	if(!previousStatus || !currentStatus || previousStatus==null || currentStatus==null)
	{
		logToConsole('Previous Status or Current Status seems to be undefined...');
		return false;
	}
	
	if(previousStatus == currentStatus)
	{
		return false;
	}
	
	if((previousStatus == stsOffline && currentStatus != stsOffline) || (previousStatus != stsOffline && currentStatus == stsOffline))
	{
		return true;
	}
    
	//if((previousStatus == stsDND && currentStatus != stsDND) || (previousStatus != stsDND && currentStatus == stsDND))
	if((previousStatus != stsAvailable && currentStatus == stsAvailable))
	{
		return true;
	}
	
	return false;
}

function updateAlertQueue(alertNames,alertStatus)
{
	alertLock=true;
	logToConsole(getDateTime() + 'alertLock=' + alertLock);
	logToConsole(getDateTime() + "============ Adding alerts to Queue Manager=========");
	for(var i=0;i<alertNames.length;i++)
	{
		var isExists = false;
		for(var j=0;j<alertQueueNames.length;j++)
		{
			logToConsole(getDateTime() + 'alertNames[' + i +']=' + alertNames[i]);
			logToConsole(getDateTime() + 'alertQueueNames[' + j +']=' + alertQueueNames[j]);
			if(alertNames[i]==alertQueueNames[j])
			{
				isExists=true;
				alertQueueStatus[j]=alertStatus[j];
			}
		}
		
		logToConsole(getDateTime() + 'isExists=' + isExists);
		
		if(!isExists)
		{
			alertQueueNames[alertQueueNames.length] = alertNames[i];
			alertQueueStatus[alertQueueStatus.length] = alertStatus[i];
		}
	}
	logToConsole(getDateTime() + "============ Done Adding alerts to Queue Manager=========");
	alertLock=false;
	logToConsole(getDateTime() + 'alertLock=' + alertLock);
}

function triggerStsChangeAlerts()
{
	logToConsole(getDateTime() + 'alertLock=' + alertLock);
	for(var i=0;i<alertQueueNames.length;i++)
	{
		logToConsole(getDateTime() + 'alertQueueNames[' + i + '] = ' + alertQueueNames[i]);
		logToConsole(getDateTime() + 'alertQueueStatus[' + i + '] = ' + alertQueueStatus[i]);
		var notificationMessage = formatUserStatusMsg(alertQueueNames[i],alertQueueStatus[i]);
		var alert_icon = determineAlertIcon(alertQueueStatus[i]);
		
		if(!alertLock && notificationMessage)
		{
			generateStatusChangeNotification(notificationMessage, alert_icon);
		}
	}
	alertQueueNames = new Array();
	alertQueueStatus = new Array();	
}

function addContact(contactName,contactStatus)
{
	logToConsole(getDateTime() + "userNamesTracker[" + userNamesTracker.length + "]=" + contactName);
	logToConsole(getDateTime() + "userStatusTracker[" + userStatusTracker.length + "]=" + contactStatus);

	userNamesTracker[userNamesTracker.length]=contactName;
	userStatusTracker[userStatusTracker.length]=contactStatus;
	
	if(userNamesTracker.length > 0 && !manageSubscriptionsLinkCreated)
	{
		logToConsole('userSubscriptionsDelayed = ' + userSubscriptionsDelayed);
		if(!userSubscriptionsDelayed)
		{
			manageSubscriptionsLinkCreated=true;
			displayStatusMessageAnimation();
			userSubscriptionRef = setTimeout(allowUserSubscriptions,timeDelay);
			alertTriggerIntervalRef = setInterval(triggerStsChangeAlerts,2*1000);
		
			$("select[style='width: 257px;']").change(function(){
				logToConsole('User changed the drop down value to ' + $(this).val());
				if("unavailable:Offline" == $(this).val())
				{
					userLoggedOut=true;
					resetState();
					logToConsole('User changed the drop down value to Logout button');
				}
			});
		}
	}
}

