function removeContact(contactName)
{
	if(!userLoggedOut)
	{
		logToConsole('isUserSubscribed(' + contactName + ')='+ isUserSubscribed(contactName));
		if(isUserSubscribed(contactName))
		{
			var newSubscribedUserNamesArray = new Array();
			for (var i=0;i<subscribedUserNamesArray.length;i++)
			{
				if(subscribedUserNamesArray[i] == contactName)
				{
					logToConsole(getDateTime() + contactName + ": ...Removed from tracker.");
				}
				else
				{
					logToConsole("newSubscribedUserNamesArray[" + newSubscribedUserNamesArray.length + "]=" + subscribedUserNamesArray[i]);
					newSubscribedUserNamesArray[newSubscribedUserNamesArray.length] = subscribedUserNamesArray[i];
				}
			}
			subscribedUserNamesArray=newSubscribedUserNamesArray;
			
			var updatedUserNamesCSVString = "";

			for(var i=0;i<subscribedUserNamesArray.length;i++)
			{
				if(i > 0)
				{
					updatedUserNamesCSVString+= ",";
				}
				updatedUserNamesCSVString+= subscribedUserNamesArray[i];
			}
			
			updateSubscriptions(updatedUserNamesCSVString);
		}
	}
}

function resetState()
{
	logToConsole('Detaching link');
	$(document).find('#userSubscriptionsLink').detach();
	$(document).find('#clipboardCopyBtn').detach();
	$(document).find('#emailBtn').detach();
	$('#manageSubscriptionsDetail').detach();
	$("#manageSubscriptionsDetailDropDown").detach();
	manageSubscriptionsLinkCreated=false;
	contactsDropDownAdded = false;
	contactsDropDownHidden = false;
	userSubscriptionsDelayed = false;
	loginUser="";

	alertQueueNames=new Array();
	alertQueueStatus=new Array();
	userNamesTracker=new Array();
	userStatusTracker=new Array();
	clearInterval(alertTriggerIntervalRef);
	
	if(userSubscriptionRef!=null)
		clearTimeout(userSubscriptionRef);
}

function handleUserLogout()
{
	resetState();
	if(observer!=null)
		observer.disconnect();
}
function initMessageMonitor(summaries) {
  var userChatMsgs = summaries[1];
  userChatMsgs.added.forEach(handleNewMsgs);
  userChatMsgs.removed.forEach(handleChatWinCloses);
}

function handleNewMsgs(newEl)
{
	no_of_msgs_on_page++;
	
	if(no_of_msgs_on_page > 0)
	{
		// Is the 'copy to clipboard' button created?
		if(!copyAndEmailButtonsCreated)
		{
			copyAndEmailButtonsCreated=true;
			logToConsole('Creating Clipboard Copy Button');
			//$(document).find('.heading').after(emailButtonDisabledHTML);
			$(document).find('.heading').after(emailButtonHTML);
			$(document).find('.heading').after(clipboardButtonHTML);
			//$('#emailBtnDisabled').hide();
			
			$('#clipboardCopyBtn').click(function() {
			  logToConsole('Performing data formatting before clipboard copy!');
			  copyOrEmail('copy');
			  logToConsole('Done copying to clipboard!');
			  alert('Data copied to clipboard!');
			});
			
			$('#emailBtn').click(function() {
			  logToConsole('Performing data formatting before emailing!');
			  copyOrEmail('email');
			  logToConsole('Done! \n(just make sure have outlook configured / open!)');
			  //alert('Done! \n(just make sure have outlook configured / open!)');
			});
		}
	}
	
	var chatMsgDiv = $(newEl);;
	logToConsole(chatMsgDiv.text());
	setChatNotificationMessage(chatMsgDiv.text());
							
	// Should we display the notification? Is window out of focus?
	if(!WindowHasFocus && notificationsSupported)
	{
		logToConsole('No focus on window, continuing to generate notification to the user!');
		createChatNotification();
	}
}

function handleChatWinCloses(newEl)
{
	no_of_msgs_on_page--;
	// Do we have a clip board button on page?
	if(no_of_msgs_on_page==0 && copyAndEmailButtonsCreated)
	{
		logToConsole('No messages available to copy! Hence removing the copy to clipboard button!');
		$(document).find('#clipboardCopyBtn').detach();
		$(document).find('#emailBtn').detach();
		//$(document).find('#emailBtnDisabled').detach();
		copyAndEmailButtonsCreated=false;
	}
}

function initGroupChatInviteMonitor(summaries) {
	var groupChatInvites = summaries[2];
	groupChatInvites.added.forEach(function(){
		setChatNotificationMessage(groupChatInviteNotificationMessage);
		// Should we display the notification? Is window out of focus?
		if(!WindowHasFocus && notificationsSupported)
		{
			logToConsole('No focus on window, continuing to generate notification to the user!');
			createChatNotification();
		}
	});
}

