// Setting up permissions for displaying notifications
function setupNotificationPermissions()
{
	logToConsole("Checking Notification support!");
	
	if (window.webkitNotifications) {
	  logToConsole("Notifications are supported by this browser!");
	  notificationsSupported=true;
	}
	else {
	  logToConsole("Notifications are not supported for this Browser/OS version yet.");
	}
	
	if(notificationsSupported && !notificationsEnabled)
	{
		if (window.webkitNotifications.checkPermission() == 0) { // 0 is PERMISSION_ALLOWED
			logToConsole('notifications enabled');
			notificationsEnabled=true;
			} else {
			logToConsole('notifications not enabled');
			window.webkitNotifications.requestPermission();// requesting for permission
			}
	 }
}

var NOTIFICATION_LEVEL=0; // supports 0,1,2
var notificationRecreationTicker=null;

function createChatNotification()
{
	generateChatNotification();
	initiateNotificationMonitor();
}

// Handle chat notification requests!
function generateChatNotification() {

	logToConsole('Checking if there is permission to generate notifications = ' + window.webkitNotifications.checkPermission());

	if(notification != null)
	{
		logToConsole('About to create a new notification, dismissing the current one!');
		dismissNotification();
	}

	logToConsole("Value of chatNotificationMessage = " + chatNotificationMessage);
	
	var notification_icon=null;
	
	if(NOTIFICATION_LEVEL==0)
	{
		logToConsole('NOTIFICATION_LEVEL=0, Setting notification icon to grey_chat_icon');
		notification_icon=green_chat_icon;
	}
	else if(NOTIFICATION_LEVEL==1)
	{
		logToConsole('NOTIFICATION_LEVEL=1, Setting notification icon to grey_green');
		notification_icon=green_orange_chat_icon;
	}
	else if(NOTIFICATION_LEVEL==2)
	{
		logToConsole('NOTIFICATION_LEVEL=2, Setting notification icon to green_red');
		notification_icon=orange_red_chat_icon;
	}
	
	// Create a simple text notification object:
	notification = webkitNotifications.createNotification(
	notification_icon,  // icon url - can be relative
	'Web Chat Notification',  // notification title
	chatNotificationMessage  // notification body text
	);
	
	// Configure notification onclick properties
	notification.onclick = function() { // What should happen when the user clicks on the notification?
	logToConsole('Configuring notification on click to focus on the window!');
	window.focus(); // open the chat window
	dismissAndClearNotification();   // dismiss the notification
	};
	
	// Notification config complete. Ready to show!
	notification.show();
}



// Handle status change notification requests!
function generateStatusChangeNotification(userStatusChangeMessage,notification_type) {

	// Create a simple text notification object:
	var stsMsgNotification = webkitNotifications.createNotification(
	notification_type,  // icon url - can be relative
	'Web Chat Status Update:',  // notification title
	userStatusChangeMessage  // notification body text
	);
	
	// Configure notification onclick properties
	stsMsgNotification.onclick = function() { // What should happen when the user clicks on the notification?
	logToConsole('Configuring notification on click to focus on the window!');
	window.focus(); // open the chat window
	this.cancel();   // dismiss the notification
	};
	
	// Notification config complete. Ready to show!
	stsMsgNotification.show();
	
	setTimeout(function(){
	stsMsgNotification.cancel();
	},7*1000);
}

function initiateNotificationMonitor()
{
	if(notificationRecreationTicker!=null)
	{
		resetNotificationMonitor();
	}
	notificationRecreationTicker=setInterval(incrementNotificationLevel,(30*1000));
	logToConsole('Setting notification timer (notificationRecreationTicker) = ' + notificationRecreationTicker);
}

function incrementNotificationLevel()
{
	logToConsole('Since the user did not really notice anything for the last x seconds, I am going to recreate notifications and start blinking the window!');
	if(NOTIFICATION_LEVEL < 2)
	{
		NOTIFICATION_LEVEL++;
	}
	
	// Recreate notification with new notification level
	generateChatNotification();
	var currentTitle = document.title;
	logToConsole('currentTitle =' + currentTitle);
}

function dismissAndClearNotification()
{
	dismissNotification();
	resetNotificationMonitor();
}


// Dismissing notifications display!
function dismissNotification()
{
	logToConsole('Invoking .cancel() on Notification');
	if(notification!=null)
		notification.cancel();
	
	notification = null;
}

function resetNotificationMonitor()
{
	// Resetting Notification Level
	logToConsole('Resetting Notification Level to zero');
	NOTIFICATION_LEVEL=0;

	logToConsole('Checking if we have to clear time outs');
	if(notificationRecreationTicker!=null)
	{
		logToConsole('Clearing set interval (notificationRecreationTicker) = ' + notificationRecreationTicker);
		clearInterval(notificationRecreationTicker);
		logToConsole('Done clearing timeout');
	}
}

// Data in the chat window is HTML div
// Before copying to clipboard we need to format HTML div information to text editor readable line breaks (/n)
function copyOrEmail(copyOrEmail)
{
	var chat_block_separator="====================";
	// + getDate() + "====================\n"
	var lineBreak='\n';
	var comma_space=', ';
	var space_and_space=' and ';
	var space = " ";
	var chatMsgs="";
	
	//1 user chat or multi user chat?
	var chat_user_index=1;
	var has_multiple_conversations = 0;
	var email_subject = "UHG Web Chat Conversation with ";

	// For every person the user is chatting with,
	// we need to find the most recent message
	var no_of_chats_in_progress = $(document).find('.tabdata').length;
	
	$(document).find('.tabdata').each(
		function(index,elem) {
				
			// Check for change in the number messages on screen
			var no_of_messages_with_specific_user_tab=$(this).find('.messageView').length;
						
			// Do we have any messages on screen?
			if(no_of_messages_with_specific_user_tab > 0)
			{
				if((chat_user_index == no_of_chats_in_progress) && chat_user_index > 1)
				{
					email_subject += space_and_space;
				}
				else if(has_multiple_conversations > 0)
				{
					email_subject += comma_space;
				}
				
				email_subject += $(this).find('.displayname').text();
				has_multiple_conversations++;
			}
			chat_user_index++;
			logToConsole('Email Subject ==> ' + email_subject);
			
			$(this).find('.jabberwerx.chatview').each(
			// For every person the user is chatting with -
				function(index,elem) {
					if($(this).find('.messageView').length > 0)
					{
						var chatHeading = chat_block_separator + space + $(this).find('.displayname').text() + space + chat_block_separator + lineBreak;
						chatMsgs+=chatHeading;

						// Read each chat line and add a line break
						$(this).find('.messageView').each(
							function(index,elem) {
							chatMsgs+=getDate() + space + $(this).text();
							chatMsgs+=lineBreak;
						});
						// Add a seperator before adding next users chat logs
						chatMsgs+=lineBreak;
						//alert(chatMsgs);
					}
				}
			);
		}
	);
	
	logToConsole('Chat formatted...' + chatMsgs);
	
	if(copyOrEmail == 'copy')
	{
		copyToClipboard(chatMsgs,email_subject);
	}
	else if(copyOrEmail == 'email')
	{
		//Hiding button for 5 seconds
		//$('#emailBtn').hide();
		
		var sMailTo =  "mailto:" + getLoginUser();
		var sMailToAndSubject =  sMailTo +"?subject=" + email_subject;
		
		logToConsole(sMailToAndSubject);
		
		var email_body_length = chatMsgs.length;
		logToConsole("email_body_length = " + email_body_length);
		
		if(email_body_length <= 2000)
		{
			sMailToAndSubject += "&body=" + escape(chatMsgs);
		}
		else
		{ 
			copyToClipboard(chatMsgs,email_subject);
			alert('Conversation too big to auto fill the Email (> 2000 chars)...\nContent copied over the Clipboard. Please paste it to email!');
		}
		
		//sMailTo += escape("<Insert Recipients Here>") +"?subject=" + email_subject +"&body=" + escape(chatMsgs);
		//sMailTo += escape("<Insert Recipients Here>") +"?subject=" + email_subject;

		$(document).find('.heading').after('<a href="' + sMailToAndSubject + '" id="emailHREF">click</a>');
		$('#emailHREF')[0].click();
		$('#emailHREF').remove();
	}
}	

