function formatUserStatusMsg(userName , userStatus)
{
	var stsDelimiter = " :: ";
	var stsAvailable = "Available";
	var stsAway = "Away";
	var stsDND = "Do Not Disturb";
	var stsOffline = "Offline";
	
	if(!userStatus || !userName)
	{
		logToConsole('User Name or Status seems to be undefined...');
		return;
	}
	
    if((userStatus == stsAway)|| (userStatus == (stsAway + stsDelimiter + stsAway)))
	{
		return userName + " is now " + stsAway;
	}
	else if (userStatus.substring(0,4) == stsAway)
	{
		return userName + " is now " + userStatus;
	}
    
	if((userStatus == stsAvailable) || (userStatus == (stsAvailable + stsDelimiter + stsAvailable)))
	{
		return userName + " is now " + stsAvailable;
	}
	else if (userStatus.substring(0,9) == stsAvailable)
	{
		return userName + " is now " + userStatus;
	}
	
	if((userStatus == stsDND)|| (userStatus == (stsDND + stsDelimiter + stsDND)))
	{
		return userName + " is now in " + stsDND + " mode.";
	}
	else if (userStatus.substring(0,14) == stsDND)
	{
		return userName + " is now " + userStatus.substring(18) + ". " + stsDND + ".";
	}
	
	if(userStatus == stsOffline)
	{
		return userName + " is now " + stsOffline;
	}
}

function determineAlertIcon(userStatus)
{
	var stsDelimiter = " :: ";
	var stsAvailable = "Available";
	var stsAway = "Away";
	var stsDND = "Do Not Disturb";
	var stsOffline = "Offline";
	
	if(!userStatus)
	{
		return;
	}
	
    if((userStatus == stsAway)|| (userStatus == (stsAway + stsDelimiter + stsAway)))
	{
		return orange_chat_icon;
	}
	else if (userStatus.substring(0,4) == stsAway)
	{
		return orange_chat_icon;
	}
    
	if((userStatus == stsAvailable) || (userStatus == (stsAvailable + stsDelimiter + stsAvailable)))
	{
		return green_chat_icon;
	}
	else if (userStatus.substring(0,9) == stsAvailable)
	{
		return green_chat_icon;
	}
	
	if((userStatus == stsDND)|| (userStatus == (stsDND + stsDelimiter + stsDND)))
	{
		return red_chat_icon;
	}
	else if (userStatus.substring(0,14) == stsDND)
	{
		return red_chat_icon;
	}
	
	if(userStatus == stsOffline)
	{
		return grey_chat_icon;
	}
}

