function getDateTime()
{
	return getDate() + " " + getTime();
}

// returns current date in mm/dd/yyyy format
function getDate()
{
	var d = new Date();

	var month = d.getMonth()+1;
	var day = d.getDate();

	var output = ((''+month).length<2 ? '0' : '') + month + '/' +
		((''+day).length<2 ? '0' : '') + day + '/' + 
		   d.getFullYear();
	
	return output;
}

function getTime()
{
	var dt = new Date();
	
	var hours = dt.getHours();
	var minutes = dt.getMinutes();
	var seconds = dt.getSeconds();
	var appendPM = false;
	
	if(hours >= 13)
	{
	   hours -= 12;
	   appendPM = true;
	}
	
	if (hours < 10) 
		 hours = '0' + hours;

	if (minutes < 10) 
		 minutes = '0' + minutes;

	if (seconds < 10) 
		seconds = '0' + seconds;
	
	var timeNow = "";
	
	if(appendPM)
		timeNow = hours + ":" + minutes + ":" + seconds + " PM ";
	else
		timeNow = hours + ":" + minutes + ":" + seconds + " AM ";

	return timeNow;
}


